webpackJsonp([5918531327027],{587:function(t,e){t.exports={data:{wordpressPost:{title:"Complimentary therapies, well-being and consultants as victims of bullying: Most read articles in July.",content:'<h1> <a href="http://blogs.bmj.com/bmjopen/files/2016/08/Tired-Doc.jpg"><img class="alignnone wp-image-1024" src="http://blogs.bmj.com/bmjopen/files/2016/08/Tired-Doc-300x200.jpg" alt="Tired Doc" width="339" height="226" srcset="http://blogs.bmj.com/bmjopen/files/2016/08/Tired-Doc-300x200.jpg 300w, http://blogs.bmj.com/bmjopen/files/2016/08/Tired-Doc-768x512.jpg 768w, http://blogs.bmj.com/bmjopen/files/2016/08/Tired-Doc-1024x683.jpg 1024w" sizes="(max-width: 339px) 100vw, 339px" /></a></h1>\n<p>July’s top 10 most read papers sees two studies taking into account doctors’ points of view. The first, by Bourne <em>et al</em>., takes a closer look at look at which aspects of the complaints process they find the most stressful. The second, by Shabazz <em>et al</em>., uses a survey of Royal College of Obstetricians and Gynaecologists to explore how significant numbers of consultants in the UK are victims of bullying.</p>\n<p>We also have a study by Linton <em>et al</em>., that systematically reviews self-report measures for assessing well-being, and a randomised controlled trial by Levett <em>et al.</em>, that concludes that the use of complementary therapies during birth can significantly reduce usage of epidurals and cesarean sections.</p>\n<table border="1" width="483" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132"><em> </em>Ravnskov<em> et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/6/6/e010401.full">Lack of an association or an inverse association between low-density-lipoprotein cholesterol and mortality in the elderly: a systematic review</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Levett, <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/6/7/e010691.full">Complementary therapies for labour and birth study: a randomised controlled trial of antenatal integrative medicine for pain management in labour</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Eleftheriou <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/6/6/e010883.full">Does attractiveness influence condom use intentions in heterosexual men? An experimental study</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132"><em> Bourne</em><em> et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/6/7/e011711.full">Doctors&#8217; experiences and their perception of the most stressful aspects of complaints processes in the UK: an analysis of qualitative survey data</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132"><em>Teschke et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/5/11/e008052.full">Bicycling injury hospitalisation rates in Canadian jurisdictions: analyses examining associations with helmet legislation and mode share</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Kristensen <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/5/9/e007118.full"> The effect of statins on average survival in randomised trials, an analysis of end point postponement</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132"><em>Shabazz,et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/6/6/e011462.full">Consultants as victims of bullying and undermining: a survey of Royal College of Obstetricians and Gynaecologists consultant experiences</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132"><em>Oudin et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/6/6/e010004.full">Association between neighbourhood air pollution concentrations and dispensed medication for psychiatric disorders in a large longitudinal cohort of Swedish children and adolescents</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132"><em>Tsubokura et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/6/6/e010970.full">Estimated association between dwelling soil contamination and internal radiation contamination levels after the 2011 Fukushima Daiichi nuclear accident in Japan</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Linton <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/6/7/e010641.full">Review of 99 self-report measures for assessing well-being in adults: exploring dimensions of well-being and developments over time</a></td>\n</tr>\n</tbody>\n</table>\n<p><!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"65b08267-0751-5af6-a225-475289ae97be"}}}});
